con:config.script:
import com.eviware.soapui.support.XmlHolder

def holder = new XmlHolder(context.testCase. getTestStepByName("Create Cust").getPropertyValue("Response"))
def custId = holder.getNodeValue("//*:result//id")
log.info custId

def request = new XmlHolder(context.testCase. getTestStepByName("Get cust by id").getPropertyValue("Request"))
def custIdResb4 = request.getNodeValue("//*:customerId")
log.info custIdResb4
request.setNodeValue("//*:customerId",custId)

def custIdRes = request.getNodeValue("//*:customerId")
log.info custIdRes


def requestDelete = new XmlHolder(context.testCase. getTestStepByName("Delete customer by id").getPropertyValue("Request"))
requestDelete.setNodeValue("//*:customerId",custId)
def custIdDelete = requestDelete.getNodeValue("//*:customerId")
log.info custIdDelete

context.testCase.setPropertyValue("CustID",custId)
//using custom properties to reflect in test suite
context.testCase.testSuite.setPropertyValue("CustID",custId)
//using custom properties to reflect in project level
context.testCase.testSuite.project.setPropertyValue("CustID",custId)
